		<script defer="defer">

			var camera, scene, renderer,
				mouseX = 0, mouseY = 0,
				particles = [];
			init();

			function init() {
				camera = new THREE.PerspectiveCamera(90, window.innerWidth / window.innerHeight, 1, 400000 );
				camera.position.set(-50,100,-200);
				camera.up = new THREE.Vector3(0,1,0);
				camera.lookAt(new THREE.Vector3(0,0,0));

				scene = new THREE.Scene();
				scene.add(camera);

				controls = new THREE.TrackballControls( camera );
				controls.target.set( 0, 0, 0 )
			//	renderer = new THREE.WebGLRenderer();

				renderer = new THREE.CanvasRenderer();
				renderer.setSize( window.innerWidth, window.innerHeight );

				document.body.appendChild( renderer.domElement );
				makeParticles();
				setInterval(update, 1000/30);

				cube = new THREE.Mesh(
					new THREE.CubeGeometry(100, 150, 200),
					new THREE.MeshBasicMaterial({
				        wireframe: true,
				        color: 'cyan'
				    }));
				scene.add(cube);
			}

			function update() {
				controls.update();
				renderer.render( scene, camera );
			}

			function makeParticles() {
				var material = new THREE.SpriteCanvasMaterial({
					color: 0xffffff,
					program: function ( context ) {
						context.beginPath();
						context.arc( 0, 0, 0.5, 0, Math.PI * 2, true );
						context.fill();
					}
				});

				var particle;

				/*
				for ( var i=0; i<points.length; i++ ) {
					particle = new THREE.Sprite( material );
					particle.position.x = points[i].x / 300; // Math.random() * 1000 - 500;
					particle.position.y = points[i].y / 300; // Math.random() * 1000 - 500;
					particle.position.z = points[i].z / 300;
					particle.scale.x = particle.scale.y = particle.scale.z = 3;
					scene.add( particle );
					particles.push(particle);
				}
				*/

				for( var i=0; i<lines.length; i++) {
					var geometry = new THREE.Geometry();

					var pfrom = new THREE.Vector3(
						lines[i].from.x / 300,
						lines[i].from.y / 300,
						lines[i].from.z / 300
					);

					var pto = new THREE.Vector3(
						lines[i].to.x / 300,
						lines[i].to.y / 300,
						lines[i].to.z / 300
					);

					geometry.vertices.push( pfrom );
					geometry.vertices.push( pto );

					var line = new THREE.Line(geometry, new THREE.LineBasicMaterial({color: lines[i].color, opacity: 1.0 }));

					scene.add( line );
				}
			}

			function particleRender( context ) {
				context.beginPath();
				context.arc( 0, 0, 2, 0,  Math.PI * 2, true );
				context.fill();
			};
